import React, { useEffect, useState } from 'react';
import axios from 'axios';

const ImageList = () => {
  const [images, setImages] = useState([]);

  useEffect(() => {
    const fetchImages = async () => {
      try {
        const response = await axios.get('https://ubt4dlosea.execute-api.us-east-1.amazonaws.com/dep/metadata?tablename=img-metadata&imgid=satish-2025_satti-tajmahal.jpg');
        console.log(response.data); // Log the response to debug
        setImages(response.data);
      } catch (error) {
        console.error('Error fetching images:', error);
      }
    };

    fetchImages();
  }, []);

  return (
    <div>
      <h2>Processed Images Metadata</h2>
      {images.map((image) => (
        <div key={image.ImgID}>
          <img src={image.S3URL} alt={image.Description} style={{ maxWidth: '100%' }} />
          <p><strong>ID:</strong> {image.ImgID}</p>
          <p><strong>Upload Timestamp:</strong> {image.UploadTimestamp}</p>
          <p><strong>Description:</strong> {image.Description}</p>
          <p><strong>Artist:</strong> {image.Artist}</p>
          <p><strong>Copyright:</strong> {image.Copyright}</p>
        </div>
      ))}
    </div>
  );
};

export default ImageList;
